import { useState } from "react";
import { Topnav } from "./components/common/topnav/Topnav";
import { Routes, Route } from "react-router-dom";
import Navbar from "./components/common/Navbar/Navbar";
import Container from "./components/common/Container/Container";
import RightNavbar from "./components/common/RightNavbar/RightNavbar";
import Dashboard from "./components/Dashboard/Dashboard";
import { Customer } from "./demo/pages/Usermanagement/Customer";

// import Team from "./components/";

import NavContext from "./components/common/Context/NavContext";
// sunny
import { ServiceCategories } from "./demo/pages/sunny/ServiceCategories";
// sunny end
export const MaxMover = () => {
  const [nav, setNav] = useState(false);
  const value = { nav, setNav };
  return (
    <>
      <Topnav />
      <div className="App">
        <NavContext.Provider value={value}>
          <Navbar />
          <Container
            stickyNav={<RightNavbar />}
            content={
              <Routes>
                <Route path="/" element={<Dashboard />} />
                <Route path="*" element={<main>NOT FOUND</main>} />
              </Routes>
            }
          />
        </NavContext.Provider>
      </div>
    </>
  );
};
